import {Link} from "react-router-dom";
import "./style.css";


function Nav(){


    return(
        <nav>
            <ul>
                <li><Link to="/"><i className="fa-solid fa-2xl fa-house-chimney-window"></i></Link></li>
                <li><Link to="/signin"><i className="fa-solid fa-2xl fa-right-to-bracket"></i></Link> </li>
                <li><Link to="/signup"><i className="fa-solid fa-2xl fa-user-plus"></i></Link></li>
            </ul>
        </nav>
    )

}

export default Nav;
